import React from "react";

function Rate(props) {
  return (
    <div>
    <div className="emptyStar">★★★★★</div>
    <div className="fullStar">★★★★★</div>
    <h2 className="rate">
      Rate: {props.rate} / {props.rateCount} Rates
    </h2>
    </div>

  );
}

export default Rate;
